import { useStore, actions } from "./store";
function ToDo() {
    const [state, dispatch] = useStore();
    const { todos, todoInput } = state;
    return (
        <>
            <input value={todoInput} placeholder="Enter todo..."
                onChange={e => { dispatch() }} />
        </>
    )
}
export default ToDo
